import React, { useState } from 'react';
import { GoogleLogin } from '@react-oauth/google';
import '../styles/Login.css';

const Login = () => {
  const [email, setEmail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Email entered:', email);
  };

  return (
    <div className="login-page">
      <div className="login-wrapper">
        {/* Left Side - Logo */}
        <div className="login-left">
          <div className="logo">X</div>
        </div>

        {/* Right Side - Content */}
        <div className="login-right">
          <h1>Happening now</h1>
          <h2>Join today.</h2>
          
          {/* Google Login */}
          <div className="google-login">
            <GoogleLogin
              onSuccess={() => console.log('Google Login Success')}
              onError={() => console.log('Google Login Failed')}
            />
          </div>

          {/* Apple Login */}
          <button className="apple-button">Sign up with Apple</button>

          <div className="divider">or</div>

          {/* Email Signup Form */}
          <form onSubmit={handleSubmit}>
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <button type="submit" className="create-account">Create account</button>
          </form>

          <p className="terms">
            By signing up, you agree to the <a href="#">Terms of Service</a> and <a href="#">Privacy Policy</a>.
          </p>

          <p className="signin">
            Already have an account? <a href="#" className="signin-link">Sign in</a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Login;
